import * as React from 'react';
import Checkbox from '@mui/material/Checkbox';
import { createTheme, ThemeProvider, styled } from '@mui/material/styles';
import colors, { orange } from './colors';

export const MyTheme = createTheme({
    palette: {
        primary: {
          main: blue[50],
        },    
        status: {
            danger: orange[500],
          },
      },
  });
